(window.webpackJsonp=window.webpackJsonp||[]).push([[10],{1090:function(e,a,o){"use strict";Object.defineProperty(a,"__esModule",{value:!0}),a.default={rentFaqs:[{i:114,q:"¿Puedo cancelar un servicio luego de la reserva?",a:"Puedes cancelar el servicio si han pasado menos de 24h de recibir el vestido, se te hará un reembolso por el total del alquiler y el depósito.",k:"devol devuel cancel cambi"},{i:101,q:"¿Qué métodos de pago puedo usar?",a:"Recibimos todas las tarjetas de crédito y pagos por transferencia bancaria por PSE.",k:"pag pse tarjeta credito visa mastercard banco medio metodo"},{i:102,q:"¿Cómo me llegan los vestidos?",a:"Todos los servicios de alquiler incluyen entrega y recogida a domicilio. Adicionalmente si compras accesorios en tu mismo alquiler, también te llegarán a domicilio.",k:"envi recibir envio recibo oficina casa ciudad urbano domicilio"},{i:103,q:"¿Qué pasa si le ocasiono un daño al vestido?",a:"Si los daños son reversibles serán cubiertos por el depósito que se deja junto con el alquiler; Si los arreglos tienen un costo inferior al valor del depósito Get2Wear reembolsa la el valor restante. En caso de ser daños irreversibles Get2Wear retendría de forma permanente el valor total del depósito para responder al/la dueña de la prenda.",k:"deposito daño perdida daño rompo rompe corta manch fisura"},{i:104,q:"¿Cuando me regresan el depósito de alquiler?",a:"El depósito será regresado una vez se valide que el vestido está en buenas condiciones. Este será consignado a tu cuenta de ahorros o corriente de tu banco de preferencia en el país.",k:"devol devuel reembols deposit"},{i:105,q:"¿Puedo hacerle modificaciones al vestido?",a:"No, todas las modificaciones, así sean temporales están prohibidas, sin excepciones. Get2Wear espera que sus clientes tomen bien las medidas de su cuerpo antes de alquilar un vestido.",k:"ajust modifica arreglo repara cose corta"},{i:106,q:"¿Debo regresar el vestido lavado?",a:"No, el servicio de alquiler incluye lavandería.",k:"lavanderia lava"},{i:108,q:"¿Cuando me llega el vestido alquilado?",a:"Entre 10 y 8 días antes de la fecha del evento Get2Wear se pondrá en contacto contigo para que definas 2 de 3 opciones de fechas en que podrías recibir el vestido (entre 7 y 4 días antes del evento, pueden variar los fechas de los días opcionados por Get2Wear según el día de la semana en que será el evento para el que necesitarás el vestido y la demanda en esa fecha) Una vez se acuerda con el dueño la entrega del vestido en una de las dos fechas que funcionan para ti, se te notifica y se define en acuerdo contigo el momento del día y el lugar para la entrega.",k:"entrega recibo"},{i:109,q:"¿Cuando me recogen el vestido luego de usarlo?",a:"Tienes entre 1 y 3 dias para ponerte en contacto o ser contactado por Lavatex para acordar la recogida del vestido en cualquier dirección dentro del área metropolitana de la ciudad donde se prestó el servicio.",k:"recoger recogida lavanderia envio domicilio ciudad"},{i:110,q:"¿Qué pasa si me atraso en la devolución del vestido más allá de la fecha límite?",a:"Si se te recoge el vestido sin previo acuerdo con LAVATEX luego de los 3 días de la fecha del evento, Get2Wear te hará un recargo del 20% del valor del alquiler por dia de retraso. Si el retraso es de más de 6 dias luego de la fecha limite, Get2Wear asumirá el caso como un hurto y retendrá la totalidad del valor del depósito y en hará la denuncia a las autoridades correspondientes.",k:"retraso lavandería devolución entrega hurto depósito"},{i:111,q:"¿Qué pasa si el vestido que me entregan no corresponde al que he alquilado?",a:"Debe notificarse antes de 24 horas a través de nuestros medios de contacto. Al validarse que el vestido no ha sido usado se revisará que su aspecto físico y/o tallas efectivamente no correspondan y de ser así se recogerá el vestido totalmente gratis y se reembolsará la totalidad del deposito.",k:"equivocacion talla vestido error devolucion cancelacion"},{i:112,q:"¿Qué garantía o devolución aplica para los accesorios?",a:"Los accesorios no tienen devoluciones ni cancelaciones por parte de Get2Wear. Cada fabricante maneja sus garantías y validará que se hayan seguido los cuidados adecuados en la manipulación y limpieza de sus accesorios; Solo si se han seguido estas recomendaciones de cada marca para los cuidados de sus accesorios y hay un daño o un deterioro ajeno a una mala manipulación, las marcas darán sus garantías (Las puedes consultar en la sesión xxxx para cada marca).. como un hurto y retendrá la totalidad del valor del depósito y en hará la denuncia a las autoridades correspondientes.",k:"devolucion garantia accesorio daño deterioro cancelacion cambi"},{i:113,q:"¿Cuando debo regresar un vestido que he alquilado?",a:"Maximo 3 dias después de la fecha del evento LAVATEX te recogerá el vestido que alquilaste.",k:"entrega devolv regresa tiempo maximo quedar dia"},{i:115,q:"¿Puedo cambiar el lugar de entrega luego de haber confirmado uno?",a:"Puedes hacer un cambio en la dirección de la entrega solo hasta 48 horas antes de la fecha previamente acordada contigo.",k:"cambi entrega envi domicilio direccion"},{i:116,q:"¿Cómo redimo los códigos para precios especiales?",a:"Una vez haces el pago del alquiler recibes un correo de confirmación de tu compra con un botón que te llevará a una ventana exclusiva para ti donde podrás desbloquear los códigos para cada marca. Para redimirlos solo tienes que darles el código correspondiente y ellos lo validarán en nuestra plataforma.",k:"redim codigo descuento promo beneficio"},{i:117,q:"¿Con cuantos días de anticipación puedo reservar?",a:"Puedes hacer una reserva de un vestido desde 4 meses antes del dia del evento, hasta 8 días antes del mismo.",k:"reserv fecha dias tiempo"},{i:118,q:"¿Cómo me entregan el vestido?",a:"Una vez hecho el pago del alquiler te contactaremos para definir cualquier lugar dentro del área metropolitana de tu ciudad para hacer la entrega.",k:"entreg envi ciudad"},{i:119,q:"¿Por cuantos dias me entregan el vestido que alquilé?",a:"Lo recibiras entre 4 y 7 días antes del evento y se te recogerá entre 2 y 4 dias despues. Get2Wear te contactara para definir todo. Si lo necesitas por más días puedes solicitar a Get2Wear que revise con la dueña del vestido si es posible hacer esta extensión por $20.000 COP, según criterio de la dueña adicionales.",k:"extend tiempo dias devol"},{i:120,q:"¿Como regreso el vestido?",a:"Tienes entre 1 y 3 dias para ponerte en contacto o ser contactado por Lavatex para acordar la recogida del vestido en cualquier dirección dentro del área metropolitana de la ciudad donde se prestó el servicio.",k:"regres devol ciudad"}],warrantyFaqs:[{i:201,q:"¿Los accesorios comprados tienen garantía?",a:'Si, es la misma garantía ofrecida por cada una de las marcas. Mira nuestra política de cambios <a href="https://s3.amazonaws.com/dressapp.public/structure/documents/Terminos+y+condiciones+GET2WEAR.pdf" target="_blank">aquí</a>.',k:"accesorio garantia marca"},{i:202,q:"¿Puedo solicitar un cambio?",a:"Si no han pasado más de 24h desde que recibiste el vestido, tienes derecho a un cambio sin costo por un vestido similar o pagando la diferencia si cuesta más.",k:"cambio envio adicional"},{i:204,q:"¿Qué pasa si el vestido que recibo tiene daños?",a:"Debe notificarlo inmediatamente el mismo día que fue recibido para que pueda ser cambiado sin costo adicional y debe presentarse en las mismas condiciones que fue recibido.",k:"daño garantia notificar cambi"}],privacyFaqs:[{i:301,q:"¿Para que me piden mi correo y mi número de teléfono?",a:'Get2Wear usa estos medios para enviar la información correspondiente a un servicio prestado y para contactarlo en caso de que se presente algún inconveniente con una entrega. Nunca compartiremos esta información con terceros que no estén involucrados la prestación del servicio solicitado, esto excluye a los mensajeros y la lavandería aliada.  Mira nuestra política de manejo de datos <a href="https://s3.amazonaws.com/dressapp.public/structure/documents/Terminos+y+condiciones+GET2WEAR.pdf" target="_blank">aquí</a>.',k:"correo telefono datos contact numero"},{i:302,q:"¿Puedo conocer la identidad de quien le pertenecen los vestidos?",a:"No, Get2Wear nunca revela ningún dato de quienes ofrecen sus vestidos en la plataforma.",k:"identidad revela conocer dueño contact"}],ownerFaqs:[{i:401,q:"¿Qué pasa si el vestido sufre un daño en el proceso de Lavandería?",a:"Si se comprueba que el vestido fue entregado tal y como se recibió por parte de la usuario cliente y que el daño fue ocasionado por la lavandería, Get2Wear asume los gastos por el arreglo y/o responde por la totalidad del valor de respaldo si así lo prefiere la dueña, si este es el caso Get2Wear retendrá la prenda de forma indefinida y esta queda bajo propiedad de Get2Wear.",k:"lavanderia daño política garantia manch"},{i:402,q:"¿Cómo sé qué día Get2Wear recogerá mi vestido que ha sido alquilado?",a:"Get2Wear te notificará una vez alguien haya pagado por el alquiler de tu vestido. En esa notificación Get2Wear te dará dos días como opcionados para recoger la prenda en perfectas condiciones para uso inmediato. Entre 2 y 1 dia antes de la fecha definida por tu Get2Wear se comunicara contigo para acordar el lugar donde debe recogerse la prenda (dentro del perímetro urbano de la ciudad relacionada) y la jornada en que puedes hacer la entrega (Mañana o tarde); El día acordado para la entrega y con anticipación, Get2Wear se pondrá en contacto contigo para notificarte la hora exacta en que pasará a recoger la prenda.",k:"recogida entrega fecha recoger alquil"},{i:403,q:"¿Qué pasa si me atraso o no cumplo con en la entrega de un vestido?",a:"Si alguien paga por el alquiler de uno de tus vestidos publicados, Get2Wear se pondrá en contacto contigo por medio de los datos que tu has facilitado para confirmar la fecha y lugar exactos para la recogida de tu vestido. Si no respondes por ninguno de los medios de contacto Get2Wear asumirá que no estás cumpliendo con su política de servicio y lo cancelara y bloqueará de manera indefinida tu cuenta en la plataforma y todos los vestidos que tengas publicados. Igualmente si sucederá si ya has confirmado día y lugar para la entrega del vestido y ese dia no cumples con la entrega o no respondes por los medios de contacto que facilitaste.",k:"incumpli servicio atraso olvid"},{i:404,q:"¿Cómo inscribo mis vestidos?",a:'Inscribete en: <a href="/alquila">www.get2wear.com/alquila</a>.',k:"inscrib registr postul subo subir tutorial"},{i:405,q:"¿Cómo puedo tomar las medidas de mi vestido?",a:'Aquí puedes ver un turorial: <a href="/tutoriales" target="_blank">VER TUTORIAL</a>',k:"medida talla inscrib tutorial"},{i:406,q:"¿Cuantas fotos debo tomarle a mis vestidos?",a:'Aprende a tomar fotos que muestren tus vestidos en su mejor ángulo: <a href="/tutoriales" target="_blank">VER TUTORIAL</a>',k:"foto inscrib tutorial"},{i:407,q:"¿Cómo me recogen y me regresan el vestido?",a:"El vestido se te recoge en cualquier lugar dentro del área metropolitana de tu ciudad en la fecha acordada contigo previamente. Tu puedes solicitar que se te regrese en cualquier otra dirección dentro de esta zona.",k:"recog regres devuel devol"},{i:408,q:"¿Qué pasa si dañan o roban mi vestido?",a:"Dresapp responde por un valor de respaldo previamente notificado y aceptado por ti (40% valor de retail que declaraste) en caso de hurto o pérdida total (Inutilidad) del vestido. Si el vestido sufre un daño menor y reparable, se hará el arreglo y se descontará del valor del depósito entregado por el/la cliente.. O podrás presentar una cotización del arreglo en el lugar de tu preferencia (Y en acuerdo con Get2Wear) y se te entregará este valor adicional a tu ganancia por el alquiler. Si el vestido sufre un daño que tu reportas como pérdida total para uso posterior del vestido, Get2Wear te responderá con el valor de respaldo (Completando la diferencia entre este y tu ganancia por el alquiler) y retendrá de manera indefinida el vestido quedando este bajo propiedad de Get2Wear (Ver terminos  condiciones).",k:"daño hurto robo respaldo garantia reparacion rompo rompe corta manch fisura"},{i:409,q:"¿Qué tipo de vestidos puedo subir a la plataforma?",a:"Cualquier tipo de vestido o prenda que tenga un valor retail como nuevo superior a $180.000 COP y que este en condiciones impecables.",k:"subi tipo public postul"},{i:410,q:"¿Qué pasa si le ocasionan un daño a mi vestido?",a:"Si el daño es reparable, Get2Wear hara un recargo por el valor del arreglo correspondiente a la cliente y este se te entregara a ti asicional a tu ganancia. Si el daño es irreversible y se arruina la prenda, Get2Wear te responde por  el 30% del valor retail como nueva y retiene la prenda indefinidamente.",k:"daño roto razga rasga mancha seguro respald"},{i:411,q:"¿Cuanto tiempo debo entregar mi vestido?",a:"Las prendas que te recogemos se te regresan entre los próximos 7 - 10 días hábiles. Get2Wear trata de entregar la prenda a la cliente con al menos 4 dias de anticipacion al dia del evento y la recoge para la lavandería entre 2 y 3 días después de este. La prenda se te regresa inmediatamente luego de hacer la lavandería.",k:"tiempo dias retien devuel devol regres"},{i:412,q:"¿Qué pasa si ya no tengo un vestido que publiqué?",a:"Get2Wear te enviará mails periódicos para comprobar la disponibilidad de tus vestidos subidos.",k:"disponib tengo vend publi subi"},{i:413,q:"¿Qué pasa si no entrego el vestido en condiciones ideales para su uso inmediato?",a:"El precio de alquiler que cobramos a la clienta incluye un servicio de lavandería, por lo que si no entregas el vestido en condiciones óptimas de limpieza Get2Wear te notificará que debe hacerse la lavandería antes de entregárselo a la clienta y puedes decidir entre si recibirlo sin proceso de lavandería luego de que ésta lo haya usado, o podemos hacer la lavandería luego de recogerselo a la clienta tambien y descontarla de tus ganancias.",k:"ideal condicion estado calidad lava"},{i:414,q:"¿En qué condiciones debo entregar mi vestido?",a:"El vestido debes entregarlo en condiciones ideales para su uso inmediato, no puede tener rastros de haber sido usado. Asi mismo Get2Wear se compromete a regresar el vestido en las mismas condiciones.",k:"ideal condicion estado calidad entreg"},{i:415,q:"¿Pueden hacerle modificaciones a mi vestido?",a:"En nuestros términos y condiciones queda terminantemente prohibido hacer cualquier tipo de modificación o ajuste permanente a los vestidos.",k:"ajust modifica arreglo repara cose corta"},{i:416,q:"¿Cuando y como me pagan mi ganancia?",a:"Una vez el proceso cierra y se comprueba el estado en que la cliente devolvió la prenda, se procede a entregasele a la dueña el valor de su ganancia en su cuenta bancaria.",k:"banc cuenta consigna ganancia gano pago recib"}]}}}]);